import React from "react";
import style from "./cards.module.css";
import Link from "next/link";

const Cards = (props) => {
  return (
    <section>
      <div className={style.containerCards}>
        <div></div>
        <div>
          <img src="cards.png" />
        </div>
      </div>
    </section>
  );
};

export default Cards;
